import React from "react";
import { Link, NavLink } from 'react-router-dom';
import "./Navbar.css";


function Navbar() {
  return (
    <nav className="NavBar">
        <div className="topheader">
            <ul>
                <li>Home</li>
                <li>Login</li>
                <li>Register</li>
                <li>Log</li>
            </ul>
        </div>
    </nav>
  );
}

export default Navbar;
